def rref(matrix):
    trans_A = matrix.copy()
    rows, cols = trans_A.shape
    r = 0
    for c in range(cols):
        if r >= rows:
            break
        pivot = np.argmax(np.abs(trans_A[r:, c])) + r

        if np.isclose(trans_A[pivot, c], 0):
            continue
        trans_A[[r, pivot]] = trans_A[[pivot, r]]
        trans_A[r] = trans_A[r] / trans_A[r, c]

        for i in range(rows):
            if i != r:
                trans_A[i] -= trans_A[i, c] * trans_A[r]
        r += 1

    return trans_A

