def extract_eigenvector_from_rref(R):
    rows, cols = Reduced.shape
    null_vec = np.zeros(cols)

    pivot_cols = []
    for r in range(rows):
        for c in range(cols):
            if np.isclose(Reduced[r, c], 1):
                pivot_cols.append(c)
