# This function converts the original transition matrix into canonical form
# by reordering states so that all transient states come before the absorbing states.
# Then, it extracts submatrices Q (transient → transient) and R (transient → absorbing),
# computes the fundamental matrix N = (I - Q)^(-1),
# and finally calculates the absorption probability matrix: B = N @ R

def absorption_prob(prob, absorbing_states):
  n = prob.shape[0]
  all_states = list(range(n))

  # Identify all non-absorbing (transient) states
  transient_states = []
  for s in all_states:
    if s not in absorbing_states:
      transient_states.append(s)

  # Reorder the transition matrix into canonical form
  canonical_order = transient_states + absorbing_states
  prob_canonical = prob[canonical_order, :][:, canonical_order]

  # Partition into Q (transient → transient) and R (transient → absorbing)
  trans = len(transient_states)
  Q = prob_canonical[:trans, :trans]
  R = prob_canonical[:trans, trans:]

  # Compute the fundamental matrix: N = (I - Q)^(-1)
  I = np.eye(trans)
  N = np.linalg.inv(I - Q)

  # Absorption probabilities: B = N @ R
  absorption_prob_A = N @ R

  return absorption_prob_A, transient_states, absorbing_states

# This function modifies the transition matrix so that any absorbing state
# has a 100% chance of remaining in itself and 0% chance of moving elsewhere.
# This is necessary before applying absorption analysis.

def make_absorbing(prob, absorbing_states):
  modify = np.array(prob, copy=True)

  for s in absorbing_states:
    modify[s, :] = 0.0
    modify[s, s] = 1.0
  return modify

