# Import the random module for simulating probabilistic transitions
import random

# This function simulates a Markov chain path from a given start state.
# It stops once an absorbing state is reached or a maximum number of steps is taken.
# The next state is chosen randomly based on the transition probabilities.

def simulate(prob, start, end, Max_steps):
  n = prob.shape[0]
  current_state = start
  steps = 0

  if end is None:
    end = set()
  else:
    end = set(end)

  for _ in range(Max_steps):
    if current_state in end:
      break
    next = np.random.choice(n, p=prob[current_state])
    current_state = next
    steps += 1

  return current_state, steps

# This function estimates the probability that, starting from A,
# the process reaches state D before state C using Monte Carlo simulation.
# C and D are treated as absorbing states and the simulation is repeated over many trials.


def estimate_probability_A_to_D_before_C(P, A, D, C, trials):
    success_count = 0
    for _ in range(trials):
        final_state, _ = simulate(
            P,
            start=A,
            end = [C, D],
            Max_steps=10000
        )
        if final_state == D:
            success_count += 1

    prob_est = success_count / trials
    return prob_est

# Run the estimation 10,000 times and print the result
est_prob = estimate_probability_A_to_D_before_C(prob, A=0, D=3, C=2, trials=10000)
print("Estimated probability (A -> D before C):", est_prob)

# This function estimates the expected number of steps required to reach F (index 5)
# from a starting state using Monte Carlo simulation.
# The simulation stops once F is reached and records the number of steps taken.

def estimate_mean_time_to_F(P, A, F, trials):
    total_steps = 0
    count_reached = 0
    for _ in range(trials):
        final_state, steps = simulate(
            P,
            start=A,
            end=[F],
            Max_steps=10000
        )
        if final_state == F:
            total_steps += steps
            count_reached += 1

    if count_reached == 0:
        return np.inf
    else:
        return total_steps / count_reached

# Estimate mean steps from A → F based on 10,000 trials
