# Define the PageRank function that calculates rank scores for each page (node)
# using the power iteration method with damping factor (d)

def pagerank(M, d=0.85, max_iter=100, tol=1.0e-6, pages=None):
    N = M.shape[0]
    p = np.ones(N) / N # Initialize the rank vector with uniform probability

    teleport = np.ones(N) / N # Teleportation vector for damping

    for iter_num in range(max_iter):
      # Compute the new rank vector using the PageRank equation:
        p_new = d * (p @ M) + (1 - d) * teleport

        # Check convergence using L1 norm; break when change is below tolerance
        if np.sum(np.abs(p_new - p)) < tol:
            print(f"Convergence: iter {iter_num}")
            break

        p = p_new

    # If page names are provided, return a sorted list of ranked pages
    if pages is not None:
        sorted_idx = np.argsort(-p)
        ranked_pages = [(pages[i], p[i]) for i in sorted_idx]
        return ranked_pages
    else:
        return p

